import React, { Component } from 'react'
import Button from '@material-ui/core/Button';
import { Link } from 'react-router-dom'
const MyLink = props => <Link to="/login" {...props} />
class LandingHome extends Component {
    render () {
        return (
           
     
    <div class="landing-container">

        <div class="landing-logo"></div>
        <h2 padding-bottom>Wellcome</h2>
            <ul>
                <li>
                    <Button component={MyLink} variant="contained" color="primary" size="lg" block>Log In</Button>
                </li>
                <li>
                    <Button  component={Link} to="/login" variant="contained" color="primary">Register</Button>
                </li>
            </ul>
    </div>    
        )
    }
}

export default LandingHome
